import { Button, Form, FormGroup, Label, Input, FormText } from 'reactstrap';

export default class CustomOrder extends React.Component {
    render() {
        return (
            <Form>
                <FormGroup id="custom-order-form" className="custom-text">
                    <FormGroup>
                        <Label for="exampleName"><h3>First and Last Name</h3></Label>
                        <Input type="name" name="name" id="exampleName" placeholder="John Doe" />
                    </FormGroup>
                    <FormGroup>
                        <Label for="exampleEmail">Email</Label>
                        <Input type="email" name="email" id="exampleEmail" placeholder="with a placeholder" />
                    </FormGroup>
                    <FormGroup>
                        <Label for="exampleText">Specific Instructions</Label>
                        <Input type="textarea" name="text" id="exampleText" />
                    </FormGroup>
                    <FormGroup>
                        <Label for="exampleFile">Image</Label>
                        <Input type="file" name="file" id="exampleFile" />
                        <FormText color="muted">
                        Choose an image from your own computer to upload. This will be the image on your custom sticker!
                        </FormText>
                    </FormGroup>
                    {/* <FormGroup tag="fieldset">
