                        <Label check>
                            <Input type="radio" name="radio1" disabled />{' '}
                            Option three is disabled
                        </Label>
                        </FormGroup>
                    </FormGroup> */}
                    <FormGroup check>
                        <Label check>
                        <Input type="checkbox" />{' '}
                        Check me out
                        </Label>
                    </FormGroup>
                    <Button>Submit</Button>
                </FormGroup>
            </Form>
        );
    }
}

